import React, { Component } from 'react'

class ProjectCard extends Component {
    render() {
        return (
            <div class="projectcard">
                <div className="imageBox">
                    <a href={this.props.tolink} target="_blank"><img src={this.props.source}></img></a>
                </div>
                <div className="imageTextBox">
                    <h3>{this.props.name} - <i>{this.props.tech}</i></h3>
                    <ul>
                        <li>{this.props.firstPoint}</li>
                        <li>{this.props.secondPoint}</li>
                        <li>{this.props.thirdPoint}</li>
                    </ul>
                </div>
            </div>
        )
    }
}

export default ProjectCard;
